using NARA.Common_p.Model;
using NARA.Util;
using System;
using System.Collections.Generic;
using System.Diagnostics;
using System.Linq;
using System.Net;
using System.Text;

using Xamarin.Forms;

namespace NARA
{
    public class App : Application
    {
        public static NavigationPage mainPage = new NavigationPage();
        public static byte[] LoaderImageInByteArray { get; set; }
        public static Stopwatch sw = new Stopwatch();
        public App()
        {
            LoaderImageInByteArray = Convert.FromBase64String(Base64Loader);
            mainPage = new NavigationPage(new HomeScreen()) { BarBackgroundColor = Color.FromHex("#1d1d1d"), BarTextColor = Color.White, BackgroundColor = Color.FromHex("#1d1d1d") };
            NavigationPage.SetHasNavigationBar(mainPage, false);
            MainPage = mainPage;
            //DependencyService.Get<IPlatformSpecific>().SaveText("", false);
        }

        static string _Token;
        public static string Token
        {
            get { return _Token; }
            set { _Token = value; }
        }

        public static void SaveToken(string token)
        {
            _Token = token;
        }

        public static Action SuccessfulLoginAction
        {
            get
            {
                return new Action(() =>
                {
                    Xamarin.Forms.Device.BeginInvokeOnMainThread(() => App.Current.MainPage.Navigation.PopAsync());
                    //Xamarin.Forms.Device.BeginInvokeOnMainThread(() => App.Current.MainPage.Navigation.PopModalAsync());
                    //Xamarin.Forms.Device.BeginInvokeOnMainThread(() => App.Current.MainPage.Navigation.PopModalAsync());
                });
            }
        }

        protected override void OnStart()
        {
            // Handle when your app starts
        }

        protected override void OnSleep()
        {
            // Handle when your app sleeps
        }

        protected override void OnResume()
        {
            // Handle when your app resumes
        }

        private string Base64Loader { get { return ""; } }
    }
}
